:12:\"cebo_address\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:18;a:5:{s:4:\"name\";s:16:\"Telephone Number\";s:4:\"desc\";s:11:\"Your digits\";s:2:\"id\";s:9:\"cebo_tele\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:19;a:5:{s:4:\"name\";s:10:\"Fax Number\";s:4:\"desc\";s:10:\"Your faxie\";s:2:\"id\";s:8:\"cebo_fax\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:20;a:5:{s:4:\"name\";s:5:\"Email\";s:4:\"desc\";s:138:\"This email will be used in various places as well as used to create the built in contact forms. If blank, it will disable the flyout forms\";s:2:\"id\";s:10:\"cebo_email\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:21;a:5:{s:4:\"name\";s:26:\"Email Newsletter Form Code\";s:4:\"desc\";s:50:\"Paste in your newsletter signup form in the footer\";s:2:\"id\";s:20:\"cebo_enewslettercode\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:8:\"textarea\";}i:22;a:5:{s:4:\"name\";s:23:\"Contact Section Heading\";s:4:\"desc\";s:55:\"This is the header in the contact areas near the footer\";s:2:\"id\";s:12:\"cebo_cheader\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:23;a:5:{s:4:\"name\";s:20:\"Contact Section Text\";s:4:\"desc\";s:59:\"This is the text blurp in the contact areas near the footer\";s:2:\"id\";s:11:\"cebo_cblurp\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:8:\"textarea\";}i:24;a:2:{s:4:\"name\";s:9:\"Socialize\";s:4:\"type\";s:7:\"heading\";}i:25;a:5:{s:4:\"name\";s:66:\"Your Facebook Username ex: (http://facebook.com/) -> somethinghere\";s:4:\"desc\";s:151:\"DO NOT USE HTTP://FACEBOOK.COM, JUST THE HANDLE By entering your facebook link, you create the links to all facebook icons or else they will not appear\";s:2:\"id\";s:13:\"cebo_facebook\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:26;a:5:{s:4:\"name\";s:36:\"Twitter Username, @ ex: cebocampbell\";s:4:\"desc\";s:152:\"DO NOT USE HTTP://TWITTER.COM, JUST THE HANDLE By entering your twitter ID you activate the twitter updates on the sidebar and various links to twitter.\";s:2:\"id\"