n more about how to get one <a href=\"http://cebocampbell.com/instagram-feed\" target=\"_blank\">here</a>: \";s:2:\"id\";s:16:\"cebo_instagramid\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:33;a:5:{s:4:\"name\";s:22:\"Instagram Access Token\";s:4:\"desc\";s:426:\"Activate Your Instagram Feed with your token: ex: 5532366.99be448.fbef473efc0141dd99bdc4428a3a62ad. Click here to grab your userid and token: <a href=\"https://instagram.com/oauth/authorize/?client_id=467ede5a6b9b48ae8e03f4e2582aeeb3&redirect_uri=http://instafeedjs.com&response_type=token\" target=\"_blank\">here</a> or, Learn more about how to get one <a href=\"http://cebocampbell.com/instagram-feed\" target=\"_blank\">here</a>: \";s:2:\"id\";s:17:\"cebo_instagramtok\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:34;a:5:{s:4:\"name\";s:35:\"Youtbe Username, @ ex: cebocampbell\";s:4:\"desc\";s:47:\"DO NOT USE HTTP://YOUTUBE.COM, JUST THE HANDLE.\";s:2:\"id\";s:12:\"cebo_youtube\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:35;a:2:{s:4:\"name\";s:18:\"Neighborhood Guide\";s:4:\"type\";s:7:\"heading\";}i:36;a:5:{s:4:\"name\";s:10:\"Map Center\";s:4:\"desc\";s:71:\"Place the coordinates for the map center here: ex: 30.181935,-85.791235\";s:2:\"id\";s:14:\"cebo_mapcenter\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:4:\"text\";}i:37;a:5:{s:4:\"name\";s:15:\"Center Map Icon\";s:4:\"desc\";s:37:\"The primary locations icon on the map\";s:2:\"id\";s:14:\"cebo_mapmarker\";s:3:\"std\";s:0:\"\";s:4:\"type\";s:6:\"upload\";}i:38;a:2:{s:4:\"name\";s:17:\"Email Newsletters\";s:4:\"type\";s:7:\"heading\";}i:39;a:5:{s:4:\"name\";s:27:\"Basic Email Newsletter Code\";s:4:\"desc\";s:287:\"This code will generate an Email Newsletter that you can edit, copy and paste into any mail service and start sending out emails to your peeps. Learn more about this newsletter feature, <a href=\"http://cebocampbell.com/wordpress-mailchimp-ready-newsletter\" target=\"_blank\">click here</a>\";s:2:\"id\";s:15:\"cebo_newsletter\";s: