INSERT INTO `wp_posts` VALUES (161,2,'2014-05-22 16:58:59','2014-05-22 16:58:59','<h2>Amenities at The Graham Hotel</h2>\nThe Graham stands out among Georgetown luxury hotels for its sophisticated style, gracious service, and innovative amenities. Our D.C. boutique hotel amenities include:\n<h3>Rooms &amp; Suites</h3>\n<ul>\n	<li>57 luxurious guestrooms and suites</li>\n	<li>Pillow top mattresses</li>\n	<li>Bed linens by Liddell Ireland</li>\n	<li>LOccitane bath amenities</li>\n	<li>Plush bath robes and slippers</li>\n	<li>Hair dryer</li>\n	<li>Complimentary Wi-Fi and hardwired high-speed internet access</li>\n	<li>Plasma LED televisions with premium cable channels</li>\n	<li>In-room pay-per-view movies</li>\n	<li>Small refrigerators available upon request</li>\n	<li>In-room dining</li>\n	<li>In-room <a href=\"http://localhost:8888/wordpress/wp-content/uploads/2014/05/MINIBAR-MENU-AND-PRICES.pdf\">mini-bar </a>and refreshment centers</li>\n	<li>In-room safe</li>\n</ul>\n<h3>Dining  A.G.B.</h3>\n<ul>\n	<li>Breakfast and dinner served daily</li>\n	<li>Healthy breakfast offerings including fresh fruit, baked goods, proteins, and beverages</li>\n	<li>Full dining menu offering soups, small bites, sandwiches, salads, and various entrees</li>\n</ul>\n<h3>Rooftop Lounge  The Observatory</h3>\n<ul>\n	<li>Graham specialty cocktails</li>\n	<li>Premium bottle service</li>\n	<li>Premium bar package</li>\n	<li>Special night cap package</li>\n</ul>\n<h3>Other Hotel Amenities</h3>\n<ul>\n	<li>On-site 24-hour fitness center</li>\n	<li>Business center with complimentary wireless printing</li>\n	<li>24-hour concierge</li>\n	<li>Valet parking (height limitation of 6 feet)</li>\n	<li>Laundry, dry cleaning and transportation services available upon request</li>\n	<li>ADA accessible rooms</li>\n</ul>','Amenities','','publish','open','closed','','dc-boutique-hotel-amenities','','','2014-05-22 16:58:59','2014-05-22 16:58:59','',0,'http://thegrahamgeorgetown.ttaws.com/?page_id=161',0,'page','',0);
INSERT INTO `wp_posts` VALUES (170,2,'2014-05-21 16:01:29','2014-05-21 16:01:29','<h3>Parking at our D.C. boutique hotel</h3>\nThe Graham Georgetown is perfectly situated on the historic, quiet and quaint Thomas Jefferson Street just off M Street, Georgetowns main shopping thoroughfare. We offer valet parking at a rate of $48 for overnight (up to 24 hours) with in-and-out privileges and $30 for the day up to 8 hours. (Maximum height for vehicles is six feet tall.)\n\n<h3>Directions to our luxury hotel in Washington DC</h3>\nFrom Union Station and Reagan National Airport, it is a 15-minute cab ride to The Graham Georgetown. Dulles and BWI are located approximately 45-50 minutes away. Our concierge would be delighted to assist you in arranging a private car service or shuttle service via SuperShuttle; please call our front desk at <a href=\"tel:2023370900\">202.337.0900</a>.','Parking & Directions','','publish','open','closed','','directions-parking','','','2014-05-21 16:01:29','2014-05-21 16:01:29','',0,'http://thegrahamgeorgetown.ttaws.com/?page_id=170',0,'page','',0);
