INSERT INTO `wp_posts` VALUES (194,2,'2014-05-21 16:05:03','2014-05-21 16:05:03','Call Hotel  <a href=\"tel:212-661-2100\">(212)-661-2100</a>\r\nToll Free - <a href=\"tel:800-248-9999 \">(800)-248-9999 </a>\r\nToll Free - <a href=\"tel:800 221 3037 \">(800) 221 3037 </a>\r\nFax - <a href=\"tel:212-818-0722\">(212)-818-0722</a>\r\n\r\nReservations: <a href=\"mailto:reservations@murrayhillsuites.com\">reservations@murrayhillsuites.com</a>\r\n\r\n<strong>Address: </strong>\r\n149 E 39th St \r\nNew York, NY 10016\r\n\r\nWhether you are new to the area or looking to plan an extended stay with us we are here to assist you. Please feel free to contact our reservation specialist by filling out the form below.\r\n\r\n[contact-form-7 id=\"104\" title=\"Contact form 1\"]','Contact Us','','publish','open','open','','we-want-to-hear-from-you','','','2014-07-22 18:36:13','2014-07-22 18:36:13','',0,'http://thegrahamgeorgetown.ttaws.com/?page_id=194',0,'page','',0);
