INSERT INTO `wp_posts` VALUES (914,2,'2014-07-07 18:41:44','2014-07-07 18:41:44','<p>The Murray Hill East provides furnished serviced apartments for stays 30 days or longer. <a href=\"http://murrayhill.wpengine.com/?page_id=37\" title=\"Our Rooms & Suites\">Our apartments</a> are ideally suited for professionals in New York for training or internships, corporate relocations, students taking courses at NYU, Cornell, Columbia or other universities in the metropolitan area, patients in Manhattan for medical treatment, corporate personnel working on long term projects, insurance relocations, etc. Whatever your purpose in New York City, rest assured we will provide you with a comfortable stay. We offer all the essential amenities you need for an extended stay in the Big Apple.</p><p>Choose from one of our <a href=\"http://murrayhill.wpengine.com/?page_id=37\" title=\"Our Rooms & Suites\">5 different sizes apartments</a> that best suit your needs. These apartments are all furnished and fully equipped with all the essentials and more. You will find our prices much more reasonable in comparison to all the other extended stay properties in New York City. At the Murray Hill East you get full value for your money.</p><p>So, if youre in New York City on an extended vacation, or youre here for school or on business for 30 days or more, please consider the Murray Hill East Suites. We will provide you with a spacious, comfortable apartment at a very affordable price. We look forward to serving you and we are confident you will have a very pleasant stay at our property.</p>','Extended Stays in Murray Hill','','publish','open','closed','','extended-stay','','','2014-07-15 16:25:56','2014-07-15 16:25:56','',0,'http://localhost:8888/wordpress/?page_id=914',0,'page','',0);
