INSERT INTO `wp_posts` VALUES (919,2,'2014-07-07 18:43:04','2014-07-07 18:43:04','The Murray Hill East has been the discerning customers home away from home for many years. Our reputation has been built on providing quality affordable accommodations for our guests from all over the world. Our central location in the midst of all New Yorks famous attractions makes our hotel a perfect choice for an <a href=\"http://murrayhill.wpengine.com/?page_id=914\" title=\"Extended Stays in Murray Hill\">extended stay</a> for you and your family. So, whether you are in New York for business or pleasure, we invite you to <a href=\"http://murrayhill.wpengine.com/?page_id=37\" title=\"Our Rooms & Suites\">experience one of our spacious, comfortable apartments</a>. We promise you a stay you wouldnt soon forget. \r\n\r\nFrom the moment you step into our well-appointed lobby, you will begin to feel the warmth and friendliness of the Murray Hill Experience. Our experienced front desk staff and our outstanding housekeeping personnel will cater to your every need. We look forward to your stay with us and extend a sincere invitation for you to come in and check out our property beforehand. ','Hotel Overview','','publish','open','open','','hotel-overview','','','2014-07-15 16:24:30','2014-07-15 16:24:30','',0,'http://localhost:8888/wordpress/?page_id=917',0,'page','',0);
INSERT INTO `wp_posts` VALUES (939,2,'2014-07-07 19:18:52','2014-07-07 19:18:52','Located in the charming historic Murray Hill district of midtown Manhattan, the Murray Hill East <a href=\"http://murrayhill.wpengine.com/?page_id=37\" title=\"Our Rooms & Suites\">offers affordable, quality apartments</a> with all the comforts of home. All of our units are fully furnished and we provide complimentary daily maid service. If you are looking for a guest friendly apartment hotel for business or pleasure and within close proximity of everything New York City has to offer, then the Murray Hill East is your place for an <a href=\"http://murrayhill.wpengine.com/?page_id=914\" title=\"Extended Stays in Murray Hill\">extended stay</a>. \r\n\r\nWe are very conveniently located to some of New York City most popular destinations, like the Chrysler building, the Empire State Building, Grand Central train station, the United Nations, NYU Medical Center as well as the headquarters of many of the Americas Fortune 500 companies. Within walking distance is Fifth Avenue shopping, Park Avenue corporations, Times Square, Madison Square Garden, Broadway theaters and Rockefeller Center. The September 11 Memorial, Central Park, the Memorial Sloan Kettering Hospital, the Jacob Javits Convention center, the citys many museums and the financial district are all just minutes away by bus, train or taxi.\r\n\r\nOur guests have free Wi-Fi access throughout the building, use of our business center, fitness center and laundry facilities. All of our spacious accommodations include complimentary daily maid service, fully equipped kitchens with dinner ware, utensils, refrigerator, microwave, toaster, stove/oven combo and coffee maker with free coffee and tea supplies. Our complimentary daily maid service feature sets us apart from all of the other short term or long term rental properties in the City. At the Murray Hill East you can expect cleanliness, comfort and great value for your money.','Long-term Stay in Murray Hill','','publish','open','open','','homepage','','','2014-07-22 20:46:29','2014-07-22 20:46:29','',0,'http://localhost:8888/wordpress/?page_id=939',0,'page','',0);
