INSERT INTO `wp_posts` VALUES (1114,2,'2014-07-17 17:55:20','2014-07-17 17:55:20','Centrally located in midtown Manhattan, the Murray Hill East puts you within easy reach of all of New York Citys major corporations, museums, universities, and all the other world famous landmarks and locations within this bustling city.\r\nWithin walking distance, youll find Grand Central train station, Penn Station, The United Nations, The Empire State building, The Chrysler Building, Rockefeller Center and Broadway theaters. The 9/11 Memorial Museum, Central Park, the citys many museums, and the financial district can all be reached within minutes by train, bus or taxi.\r\n\r\n<script type=\"text/javascript\" src=\"http://maps.google.com/maps/api/js?sensor=false\"></script><div style=\"overflow:hidden;height:500px;width:650px;\"><div id=\"gmap_canvas\" style=\"height:600px;width:650px;\"></div><style>#gmap_canvas img{max-width:none!important;background:none!important}</style><a class=\"google-map-code\" href=\"http://www.sparbalu.com\" id=\"get-map-data\">www.sparbalu.com</a></div><script type=\"text/javascript\"> function init_map(){var myOptions = {zoom:13,center:new google.maps.LatLng(40.749306,-73.97630500000002),mapTypeId: google.maps.MapTypeId.ROADMAP};map = new google.maps.Map(document.getElementById(\"gmap_canvas\"), myOptions);marker = new google.maps.Marker({map: map,position: new google.maps.LatLng(40.749306, -73.97630500000002)});infowindow = new google.maps.InfoWindow({content:\"<b>Murray Hill East Suites</b><br/>149 E 39th Street<br/>10016 New York\" });google.maps.event.addListener(marker, \"click\", function(){infowindow.open(map,marker);});infowindow.open(map,marker);}google.maps.event.addDomListener(window, \'load\', init_map);</script>\r\n','Around Murray Hill','','publish','open','open','','location','','','2014-07-21 18:18:08','2014-07-21 18:18:08','',0,'http://murrayhill.wpengine.com/?page_id=1114',0,'page','',0);
