INSERT INTO `wp_posts` VALUES (1149,2,'2014-07-30 16:20:14','2014-07-30 16:20:14','Features 2 bedrooms with 2 queen beds in 2 baths, separate living room with queen sofa bed, love seat, club chairs, desk, dresser, cocktail table, dining table, HD plasma TV with cable channels in bedroom and living room. Fully equipped kitchen with refrigerator, stove/oven combo, dish washer, coffee maker with free coffee and tea supplies, toaster and microwave. Radio alarm clock, smoke alarm, iron and ironing board, safe deposit box in room. Full bathroom with hair dryer, sewing kit, shower cap, soap, shampoo and body lotion included.','Two bedroom apartment - 1200 square feet.','Features 2 bedrooms with 2 queen beds in each bedroom, 2 baths, separate living room with queen sofa bed, love seat, club chairs, desk, dresser, cocktail table, dining table, HD plasma TV with cable channels in bedroom and living room. Fully equipped kitchen with refrigerator, stove/oven combo, dish washer, coffee maker with free coffee and tea supplies, toaster and microwave. Radio alarm clock, smoke alarm, iron and ironing board, safe deposit box in room. Full bathroom with hair dryer, sewing kit, shower cap, soap, shampoo and body lotion included.','inherit','open','open','','954-autosave-v1','','','2014-07-30 16:20:14','2014-07-30 16:20:14','',954,'http://murrayhill.wpengine.com/?p=1149',0,'revision','',0);
